export const charToString = (char: string): string => {
  const charMap: { [key: string]: string } = {
    $: 'dollar',
    '&': 'ampersand',
    '(': 'parenleft',
    ')': 'parenright',
    '*': 'asterisk',
    '+': 'plus',
    ',': 'comma',
    '-': 'hyphen',
    '.': 'period',
    ':': 'colon',
    ';': 'semicolon',
    '?': 'question',
    '@': 'at',
    '~': 'tilde',
    ' ': 'space',
  };

  return charMap[char] || char;
};

export const chromaSolidstringToPoints = (str: string): string[] => {
  return str.split('').map((char) => {
    return chromaSolid[charToString(char)];
  });
};

export const chromaSegmentedStringToPoints = (str: string): string[] => {
  return str.split('').map((char) => {
    return chromaSegmented[charToString(char)];
  });
};
